svg.script:
var CountFl = 0;
var CountKl = 0;
var CountKon = 0;
var CountSchalt = 0;

var VollschaltZyloffen = document.getElementById("VollschaltZyloffen");
var VollschaltZylgedackt = document.getElementById("VollschaltZylgedackt");
var VollschaltKon = document.getElementById("VollschaltKon");
var SchalterZyloffen = document.getElementById("SchalterZyloffen");
var SchalterZylgedackt = document.getElementById("SchalterZylgedackt");
var SchalterKon = document.getElementById("SchalterKon");
var SchalterZyloffengedrueckt = document.getElementById("SchalterZyloffengedrueckt");
var SchalterZylgedacktgedrueckt = document.getElementById("SchalterZylgedacktgedrueckt");
var SchalterKongedrueckt = document.getElementById("SchalterKongedrueckt");
var Rohroffen = document.getElementById("Rohroffen");
var Zylinder = document.getElementById("Zylinder");
var Konus = document.getElementById("Konus");
var FlDruck = document.getElementById("FlDruck");
var KlarDruck = document.getElementById("KlarDruck");
var KonDruck = document.getElementById("KonDruck");

function addEventListeners() {
    VollschaltZyloffen.addEventListener('mousedown', gedruecktFl);
    VollschaltZyloffen.addEventListener('mouseup', losgelassenFl);
    VollschaltZyloffen.addEventListener('mouseout', fortbewegtFl);
    VollschaltZylgedackt.addEventListener('mousedown', gedruecktKl);
    VollschaltZylgedackt.addEventListener('mouseup', losgelassenKl);
    VollschaltZylgedackt.addEventListener('mouseout', fortbewegtKl);
    VollschaltKon.addEventListener('mousedown', gedruecktKon);
    VollschaltKon.addEventListener('mouseup', losgelassenKon);
    VollschaltKon.addEventListener('mouseout', fortbewegtKon);
}

addEventListeners()

function gedruecktFl() {
    SchalterZyloffen.classList.remove("sichtbar");
    SchalterZyloffen.classList.add("unsichtbar");
    SchalterZyloffengedrueckt.classList.remove("unsichtbar");
    SchalterZyloffengedrueckt.classList.add("sichtbar");

}

function losgelassenFl() {
    SchalterZyloffen.classList.remove("unsichtbar");
    SchalterZyloffen.classList.add("sichtbar");
    SchalterZyloffengedrueckt.classList.remove("sichtbar");
    SchalterZyloffengedrueckt.classList.add("unsichtbar");
    if (CountFl == 0) {
    Rohroffen.classList.remove("aus");
    Rohroffen.style.stroke = "#77ddff";
    FlDruck.classList.add("einblenden");
    FlDruck.classList.remove("ausblenden");
    CountFl = 1;
    } else {
    Rohroffen.style.stroke = "";
    Rohroffen.classList.add("aus");
    FlDruck.classList.add("ausblenden");
    FlDruck.classList.remove("einblenden");
    CountFl = 0;
    }
}

function fortbewegtFl() {
    SchalterZyloffen.classList.remove("unsichtbar");
    SchalterZyloffen.classList.add("sichtbar");
    SchalterZyloffengedrueckt.classList.remove("sichtbar");
    SchalterZyloffengedrueckt.classList.add("unsichtbar");
}

function gedruecktKl() {
    SchalterZylgedackt.classList.remove("sichtbar");
    SchalterZylgedackt.classList.add("unsichtbar");
    SchalterZylgedacktgedrueckt.classList.remove("unsichtbar");
    SchalterZylgedacktgedrueckt.classList.add("sichtbar");

}

function losgelassenKl() {
    SchalterZylgedackt.classList.remove("unsichtbar");
    SchalterZylgedackt.classList.add("sichtbar");
    SchalterZylgedacktgedrueckt.classList.remove("sichtbar");
    SchalterZylgedacktgedrueckt.classList.add("unsichtbar");
    if (CountKl == 0) {
    Zylinder.classList.remove("aus");
    Zylinder.style.stroke = "#ff7788";
    KlarDruck.classList.add("einblenden");
    KlarDruck.classList.remove("ausblenden");
    CountKl = 1;
    } else {
    Zylinder.style.stroke = "";
    Zylinder.classList.add("aus");
    KlarDruck.classList.add("ausblenden");
    KlarDruck.classList.remove("einblenden");
    CountKl = 0;
    }
}

function fortbewegtKl() {
    SchalterKon.classList.remove("unsichtbar");
    SchalterZylgedackt.classList.add("sichtbar");
    SchalterZylgedacktgedrueckt.classList.remove("sichtbar");
    SchalterZylgedacktgedrueckt.classList.add("unsichtbar");
}

function gedruecktKon() {
    SchalterKon.classList.remove("sichtbar");
    SchalterKon.classList.add("unsichtbar");
    SchalterKongedrueckt.classList.remove("unsichtbar");
    SchalterKongedrueckt.classList.add("sichtbar");
}

function losgelassenKon() {
    SchalterKon.classList.remove("unsichtbar");
    SchalterKon.classList.add("sichtbar");
    SchalterKongedrueckt.classList.remove("sichtbar");
    SchalterKongedrueckt.classList.add("unsichtbar");
    if (CountKon == 0) {
    Konus.classList.remove("aus");
    Konus.style.stroke = "#00ee00";
    KonDruck.classList.add("einblenden");
    KonDruck.classList.remove("ausblenden");
    CountKon = 1;
    } else {
    Konus.style.stroke = "";
    Konus.classList.add("aus");
    KonDruck.classList.add("ausblenden");
    KonDruck.classList.remove("einblenden");
    CountKon = 0;
    }
}

function fortbewegtKon() {
    SchalterKon.classList.remove("unsichtbar");
    SchalterKon.classList.add("sichtbar");
    SchalterKongedrueckt.classList.remove("sichtbar");
    SchalterKongedrueckt.classList.add("unsichtbar");
}
